//
// Arguments    : double x_data[]
//                int x_size[2]
// Return Type  : void
//
static void fliplr(double x_data[], int x_size[2])
{
  int n;
  int nd2;
  int b_j1;
  int j2;
  double xtmp;
  n = x_size[1] - 1;
  nd2 = x_size[1] >> 1;
  for (b_j1 = 0; b_j1 + 1 <= nd2; b_j1++) {
    j2 = n - b_j1;
    xtmp = x_data[b_j1];
    x_data[b_j1] = x_data[j2];
    x_data[j2] = xtmp;
  }
}

//
// Arguments    : double x[536]
// Return Type  : void
//
static void flipud(double x[536])
{
  int i;
  double xtmp;
  for (i = 0; i < 268; i++) {
    xtmp = x[i];
    x[i] = x[535 - i];
    x[535 - i] = xtmp;
  }
}

//
// Arguments    : const double Y[3]
//                const double X_data[]
//                const int X_size[1]
//                double no_data[]
//                int no_size[2]
// Return Type  : void
//
static void hist(const double Y[3], const double X_data[], const int X_size[1],
                 double no_data[], int no_size[2])
{
  int edges_size[2];
  int k;
  double edges_data[1511];
  double nn_data[1511];
  int nn_size[1];
  edges_size[0] = 1;
  edges_size[1] = (short)(X_size[0] + 1);
  for (k = 0; k <= X_size[0] - 2; k++) {
    edges_data[k + 1] = X_data[k] + (X_data[k + 1] - X_data[k]) / 2.0;
  }

  edges_data[0] = rtMinusInf;
  edges_data[(short)(X_size[0] + 1) - 1] = rtInf;
  for (k = 1; k - 1 <= X_size[0] - 2; k++) {
    edges_data[k] += eps(edges_data[k]);
  }

  histc(Y, edges_data, edges_size, nn_data, nn_size);
  no_size[0] = 1;
  no_size[1] = nn_size[0] - 1;
  for (k = 0; k <= nn_size[0] - 2; k++) {
    no_data[k] = nn_data[k];
  }

  if (nn_size[0] - 1 > 0) {
    no_data[nn_size[0] - 2] += nn_data[nn_size[0] - 1];
  }
}

//
// Arguments    : const double X[3]
//                const double edges_data[]
//                const int edges_size[2]
//                double N_data[]
//                int N_size[1]
// Return Type  : void
//
static void histc(const double X[3], const double edges_data[], const int
                  edges_size[2], double N_data[], int N_size[1])
{
  int xind;
  int k;
  int low_i;
  int low_ip1;
  int high_i;
  int mid_i;
  N_size[0] = (short)edges_size[1];
  xind = (short)edges_size[1];
  for (k = 0; k < xind; k++) {
    N_data[k] = 0.0;
  }

  xind = 0;
  for (k = 0; k < 3; k++) {
    low_i = 0;
    if (!rtIsNaN(X[xind])) {
      if ((X[xind] >= edges_data[0]) && (X[xind] < edges_data[edges_size[1] - 1]))
      {
        low_i = 1;
        low_ip1 = 2;
        high_i = edges_size[1];
        while (high_i > low_ip1) {
          mid_i = (low_i >> 1) + (high_i >> 1);
          if (((low_i & 1) == 1) && ((high_i & 1) == 1)) {
            mid_i++;
          }

          if (X[xind] >= edges_data[mid_i - 1]) {
            low_i = mid_i;
            low_ip1 = mid_i + 1;
          } else {
            high_i = mid_i;
          }
        }
      }

      if (X[xind] == edges_data[edges_size[1] - 1]) {
        low_i = edges_size[1];
      }
    }

    if (low_i > 0) {
      N_data[low_i - 1]++;
    }

    xind++;
  }
}

