static void wc1mod(const double x[250], const double f_data[], const int f_size
                   [2], double y_data[], int y_size[2])
{
  int loop_ub;
  int iC;
  double b_data[21];
  double b_b_data[21];
  int mc;
  double c_data[270];
  int iB;
  int i;
  int lastRowA;
  int aidx;
  int cidx;
  int r;
  loop_ub = f_size[1];
  for (iC = 0; iC < loop_ub; iC++) {
    b_data[iC] = f_data[iC];
  }

  loop_ub = f_size[1];
  for (iC = 0; iC < loop_ub; iC++) {
    b_b_data[iC] = b_data[iC];
  }

  if (f_size[1] == 0) {
    mc = 250;
  } else {
    mc = f_size[1] + 249;
  }

  for (iC = 0; iC < mc; iC++) {
    c_data[iC] = 0.0;
  }

  if (!(f_size[1] == 0)) {
    iC = 0;
    iB = 0;
    for (i = 0; i < loop_ub; i++) {
      if (i + 250 <= mc - 1) {
        lastRowA = 250;
      } else {
        lastRowA = mc - i;
      }

      aidx = 0;
      cidx = iC;
      for (r = 1; r <= lastRowA; r++) {
        c_data[cidx] += b_b_data[iB] * x[aidx];
        aidx++;
        cidx++;
      }

      iB++;
      iC++;
    }
  }

  y_size[0] = 1;
  y_size[1] = mc;
  for (iC = 0; iC < mc; iC++) {
    y_data[iC] = c_data[iC];
  }
}

