// Return Type  : void
//
static void wk1mod(const double x_data[], const int x_size[2], double y_data[],
                   int y_size[2])
{
  int loop_ub;
  int i2;
  double d;
  int last;
  y_size[0] = 1;
  y_size[1] = x_size[1];
  loop_ub = x_size[0] * x_size[1];
  for (i2 = 0; i2 < loop_ub; i2++) {
    y_data[i2] = x_data[i2];
  }

  if (250 < x_size[1]) {
    d = ((double)x_size[1] - 250.0) / 2.0;
    loop_ub = (int)std::floor(d);
    last = x_size[1] - (int)std::ceil(d);
    if (1 + loop_ub > last) {
      i2 = 1;
      last = 0;
    } else {
      i2 = loop_ub + 1;
    }

    y_size[0] = 1;
    y_size[1] = (last - i2) + 1;
    loop_ub = (last - i2) + 1;
    for (last = 0; last < loop_ub; last++) {
      y_data[last] = x_data[(i2 + last) - 1];
    }
  }
}

